import React, { useState } from 'react';
import "./Sidebar.css"
import {SidebarData} from "./SidebarData"
import {Links} from "react-scroll"
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as Bs from "react-icons/bs";

import {Link }  from 'react-router-dom'


export default function Sidebar() {

    const [sidebar, setSidebar] = useState(false)

    const showSidebar = () => setSidebar(!sidebar) 




    return (



        <div className="Sidebar">


        <Links to="#" className="right-arrow" >

            <Bs.BsArrowBarRight onClick={showSidebar} />

         </Links>

         <Links to="#" className="left-arrow" >

            <Bs.BsArrowBarLeft onClick={showSidebar} />

            </Links>


            <nav className={sidebar ? "sidebar-active" : "nav-menu"}>

                {SidebarData.map((val, key) => {
                return (

                    <ul>
                        <li>

                        <Links className="links" 
                            activeClass="active"
                            to={val.title}
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                             >

                        <div id="icon" >
                            {val.icon}
                        </div>
                        <div id="title">
                            {val.title}
                        </div>

                        </Links>

                        </li>
                    </ul>



                        )

                })}






            </nav>

            </div>
    )
}













